import React, { Component } from 'react';


class About extends Component {
    render() {
        return (
            <div className="col-home"> 
            <h1 className="subtopic">About Me</h1>
            <p className="about"><center>
            <h4>Hey there,</h4>
            <h1>I am Zary G. Manning</h1>
            <h3>Front End Web <u>Developer</u> | UI/UX <u>Designer</u></h3>
            </center></p>
            <br></br>
            <p className="about">
            For the love of design and the love of learning, software development is a passion.
            <br></br>
            <br></br>
            As technology continues to make unknown things possible, my hope is that I can play a small role in making that technology both easy to use and beautiful.

            </p>

            </div>
            )
        }
    }

export default About
